void mainImage( out vec4 o, vec2 u )
{
    o.xyz = iResolution;
    u = 3.*(u+u-o.xy)/o.y; 
    o -= o;

    for (float i; i++ < 5.; o.xz *= mat2(.9, -1, 1, .4))        
        o += .3 / i / i
           / cosh(dot(u /= 1. - (2.-i) * dot(u+7.,u) / 1e2, 
                      u) / 90.
                 )
           / length(.7 + tanh(9.*cos(i*u+iTime+o.xz*9.)));           
}
